





-- Update the values because the trigger on the personal_finance table is used to create the record on a insertion of public.users
ON CONFLICT ("id")
DO UPDATE SET
    "user_id" = EXCLUDED."user_id",
    "start_date" = EXCLUDED."start_date",
    "rates" = EXCLUDED."rates",
    "stop_invest" = EXCLUDED."stop_invest",
    "start_withdrawl" = EXCLUDED."start_withdrawl",
    "money_needed_to_live" = EXCLUDED."money_needed_to_live",
    "tax_bracket" = EXCLUDED."tax_bracket",
    "tax_bracket_future" = EXCLUDED."tax_bracket_future",
    "premium_deposit" = EXCLUDED."premium_deposit",
    "ytd_collections" = EXCLUDED."ytd_collections",
    "default_tax_rate" = EXCLUDED."default_tax_rate";




